import axios from"axios";import api from"../interceptor";const token=localStorage.getItem("access_token");class AuthService{async getToken(data){try{return await api.post("/api/token/",data)}catch(error){return console.log(error.response),error.response.data}}async refresh(data){try{return await api.post("/api/token/refresh/",data)}catch(error){return console.log(error.response),error.response.data}}}export default AuthService;